;require.register("demos/mixin/template.html", function(exports, require, module) {
module.exports = "<h2>mixin</h2>\n\n<p>Mixins provide a multiple-inheritance like facility.</p>\n\n<p>The Mixin class provides 3 static methods to create mixins:</p>\n\n<ul>\n\t<li>Mixin.with(...mixins)</li>\n\t<li>Mixin.from(baseClass, ...mixins)</li>\n\t<li>Mixin.to(toClass, ...mixins)</li>\n</ul>\n\n<h3>Using Mixins:</h3>\n\n<h4>Mixin.with(...mixins)</h4>\n\n<p>The simplest method, Mixin.with() takes a list of mixins and applies them to an emply base class. It then returns the resulting class, which can then be extended or instantiated.</p>\n\n<p>You can see it in action on line 6 of Countdown.js below, where it is used to allow Countdown objects to act like both Promises and EventTargets.</p>\n\n[[editor]]\n\n<h4>Mixin.from(baseClass, ...mixins)</h4>\n\n<p>Mixin.from() takes a base class and a list of mixins. It extends the base class, and applies the mixin to the new class before returning it.</p>\n\n<h4>Mixin.to(toClass, ...mixins)</h4>\n\n<p>Mixin.to() takes a class and a list of mixins. It then applies the mixins to the class, in-place.</p>\n"
});

