;require.register("demos/theme/template.html", function(exports, require, module) {
module.exports = "<h2>theme</h2>\n\n<p>Themes allow you to map arbitrary types to <a cv-link = \"views\">Views</a>, and if necessary, views to their templates for an added level of abstraction. This behavior can be supplemented with additional views and templates at runtime.</p>\n\n<p>Themes can fallback on other themes if they don't have the View or Template for the given object.</p>\n\n<h3>Usage:</h3>\n\n<p>All the editors on this page are linked, so modifying any files and clicking execute will propagate to the results tab of the first one.</p>\n\n[[basicEditor]]\n\n<h4>Types</h4>\n\n<p>These are the objects that will be mapped to views. They will be given <a cv-link = \"/bindables\">Bindable</a> wrappers, then provided to <a cv-link = \"/views\">Views</a> as their args property.</p>\n\n<p>Note that you'll need to modify the object through the Bindable wrapper to propagate the changes up to the view.</p>\n\n<p>TypeX.js achieves this by creating the Bindable in the constructor. Subsequent calls to Bindable.make will return the same reference. TypeZ.js returns the bindable from the constructor, so other objects will have the Bindable reference by default. Its child class, TypeZAlpha then does not need to repeat this pattern. the value in TypeY is constant, so we do not make it Bindable by default.</p>\n\n[[typeEditor]]\n\n<h4>Views</h4>\n\n<p>Here are the views that handle the actual output. Their templates will also be pulled from the theme.</p>\n\n[[viewEditor]]\n\n<h4>Templates</h4>\n\n<p>Here are the templates that are used to display the output.</p>\n\n[[templateEditor]]\n"
});

