;require.register("experiments/InfiniteScroll/template.html", function(exports, require, module) {
module.exports = "<h2>experimental scrollers</h2>\n\n<p>These scroll boxes automatically remove any DOM elements that are no longer visible to the user. This allows us to make large scrollable boxes without wasting large amounts of computing power on DOM calculations for records that may never become visible.</p>\n\n<div class = \"row wide line-up\">\n\n\t<div class = \"wide\">\n\t\t<h3>simple scroller</h3>\n\n\t\t<p>This scroller uses an array of <b>[[simpleRows|thousands]]</b> integers.</p>\n\t\t<p>Building large arrays can have significant overhead.</p>\n\n\t\t<button cv-on = \"click:increase(event)\">increase to 1,000,000</button>\n\n\t\t<div class = \"simple scroller\">\n\t\t\t[[arrayScroller]]\n\t\t</div>\n\n\t</div>\n\n\t<div class = \"wide\">\n\n\t\t<h3>string scroller</h3>\n\n\t\t<p>This scroller uses a RecordSet  that returns <b>1,000,000</b> strings.</p>\n\t\t<p>This list was able to populate quickly because RecordSets defer loading.</p>\n\n\t\t<div class = \"string scroller\">\n\t\t\t[[stringScroller]]\n\t\t</div>\n\n\t</div>\n\n\t<div class = \"wide\">\n\n\t\t<h3>view scroller</h3>\n\n\t\t<p>This scroller uses a RecordSet that returns <b>1,000,000</b> curvature View objects.</p>\n\t\t<p>There is a 250ms <b>simulated</b> load time on each row.</p>\n\n\t\t<div class = \"views scroller\">\n\t\t\t[[viewScroller]]\n\t\t</div>\n\n\t</div>\n\n</div>\n\n<h3>table scroller</h3>\n\n<p>This scroller uses flexbox, and a custom template to simulate a table. Its RecordSet returns <b>[[rows|thousands]]</b> plain objects.</p>\n\n<p>The number of records and row height can be altered on the fly as well, this is common to all Scrollers.</p>\n\n<p>Counting both the texboxes & sliders, there are 2,000,002 input fields avaiable below, each mapped to an object in memory.</p>\n\n<p><b>NOTE:</b> This is currently limited by the scroll-height limit of <u>33,554,400 pixels</u> imposed by webkit.</p>\n\n<div class = \"row wide\">\n\n\t<div class = \"wide\">\n\t\t<label class = \"row wide\">\n\t\t\t<p>Rows:&nbsp;<input cv-bind = \"rows\" type = \"number\" min = \"0\" /></p>\n\t\t</label>\n\t</div>\n\n\t<div class = \"wide\">\n\t\t<label  class = \"row wide\">\n\t\t\t<p>Row Height [[rowHeight|leftPad]]px</p>\n\t\t\t<input cv-bind = \"rowHeight\" type = \"range\" max = \"100\" />\n\t\t</label>\n\t</div>\n\n\t<div class = \"wide\">\n\t\t<label  class = \"row wide\">\n\t\t\t<p>Scroll on change?</p>\n\t\t\t<input cv-bind = \"changedScroll\" type = \"checkbox\" value = \"1\" />\n\t\t</label>\n\t</div>\n\n</div>\n\n<div class = \"grid scroller\">\n\t[[gridScroller]]\n</div>\n\n<div class = \"row wide\">\n\t<div class = \"row wide\">\n\t\tPosition: [[gridScroller.args.scrollTop]] / [[gridScroller.args.scrollMax]]\n\t</div>\n\t<div class = \"row wide\">\n\t\tSpeed: [[gridScroller.args.speed]] px/s\n\t</div>\n</div>\n\n<h3>disembodied scrollbars</h3>\n\n<div class = \"row centered spaced-out\">\n\t<div class = \"row centered\">\n\t\t[[vertScroller]]\n\t\t<div class = \"lonebar-value\">[[vertScroller.args.value]]</div>\n\t</div>\n\t<div  class = \"col centered\">\n\t\t[[horizScroller]]\n\t\t<div class = \"lonebar-value\">[[horizScroller.args.value]]</div>\n\t</div>\n</div>\n\n<!-- <h3>truly infinite scrolling</h3>\n\n<div class = \"truly-infinite-scroller\">\n\t[[infiniteVertScroller]]\n</div>\n -->\n"
});

