;require.register("home/template.html", function(exports, require, module) {
module.exports = "<h2>curvature</h2>\n\n<p>curvature is a lightweight javascript framework with an emphasis on straightforwardness.</p>\n\n<p><i>Author's note: Although this is an <b>extremely</b> fun project to work on, I use shop-standard tools when working in the office.</i></p>\n\n<h4>install with npm:</h4>\n\n<p>the recommended way to get curvature is via <a cv-link = \"https://npmjs.com/package/curvature\">npm</a>:</p>\n\n<code>$ npm i curvature</code>\n\n<br />\n\n<h4>include via cdn:</h4>\n\n<p>curvature is also available from unpkg:</p>\n\n<p><a cv-link = \"https://unpkg.com/curvature@[[version]]/dist/curvature.js\">link</a>:</p>\n<code>&lt;script src = \"https://unpkg.com/curvature@[[version]]/dist/curvature.js\"&gt;&lt;/script&gt;</code>\n\n<br />\n\n<h4>curvature projects</h4>\n\n<div class = \"row\">\n\t<div class = \"project\">\n\t\t<h5>Sonic 3000</h5>\n\t\t<img src = \"/sonic-3000.png\" />\n\t\t<p><b>Sonic 3000</b> is a browser based 2d platforming game styled aftet the Sonic games for Genesis from the 1990s.</p>\n\t\t<p>Features full gamepad support, P2P multiplayer, eight playable characters, elemental sheilds, new moves, and vehicles for both land and air.</p>\n\t\t<p>View the README for full control instructions.</p>\n\t\t<p><a href = \"https://github.com/seanmorris/pixel-physics\">view the project on github</a></p>\n\t\t<p><a href = \"https://pixel-physics.seanmorr.is/\">view the live demo</a></p>\n\t</div>\n\n\t<div class = \"project\">\n\t\t<h5>Nynex 95</h5>\n\t\t<img src = \"/nynex-95.png\" />\n\t\t<p><b>Nynex 95</b> simulates the look and feel of Windows 95 in the browser. Features include task management, a basic terminal, \"pop-out\" windows with a working task bar (double click the titlebars to \"pop\" windows out of the browser).</p>\n\t\t<p>The project also features a text editor inside the \"Repo Browser\" app that can edit the code in its own repo live when authenticaed via the github api. </p>\n\t\t<p><a href = \"https://github.com/seanmorris/nynex95\">view the project on github</a></p>\n\t\t<p><a href = \"https://nynex.seanmorr.is/\">view the live demo</a></p>\n\t</div>\n\n</div>\n\n<div class = \"row\">\n\n\t<div class = \"project\">\n\t\t<h5>Bit Canvas</h5>\n\t\t<img src = \"/bit-canvas.png\" />\n\t\t<p><b>Bit Canvas</b> parses Pokemon Red/Blue ROM files and allows the user to extract images and monster statistice directly from the gameboy machine code.</p>\n\t\t<p><a href = \"https://github.com/seanmorris/bit-canvas\">view the project on github</a></p>\n\t\t<p><a href = \"https://bit-canvas.seanmorr.is/\">view the live demo</a></p>\n\t</div>\n\n\t<div class = \"project\">\n\t\t<h5>php-wasm</h5>\n\t\t<img src = \"/php-wasm.png\" />\n\t\t<p><b>php-wasm</b> allows the user to write and execute PHP live in the browser, fully client-side. The system is powerful enough to boot Drupal 7 and display its homepage, with extensions like SQLite modified to compile statically. Cookie-based logins are still yet-to-be implemented.</p>\n\t\t<p><a href = \"https://github.com/seanmorris/php-wasm\">view the project on github</a></p>\n\t\t<p><a href = \"\">view the live demo</a></p>\n\t</div>\n\n</div>\n\n<div class = \"row\">\n\n\t<div class = \"project\">\n\t\t<h5>Reckon</h5>\n\t\t<img src = \"/ansi-colors.png\" />\n\t\t<p><b>Reckon</b> is a parsing library inspired by <a href = \"https://docs.raku.org/language/grammars\">Perl 6 Grammars.</a></p>\n\t\t<p>Demo features parsing & rendering of ANSI color & formating codes.</p>\n\t\t<p>Supports 4, 8 and 24 bit coloring, text & binary input, as well as the terminal BEL (type \"\\a\" in the input field).</p>\n\t\t<p><a href = \"https://github.com/seanmorris/reckon\">view the project on github</a></p>\n\t\t<p><a href = \"https://ansi.seanmorr.is/\">view the live demo</a></p>\n\t</div>\n\n</div>\n\n<br />\n\n<h4>source</h4>\n\n<p>the curvature source code is available on github:</p>\n\n<code>$ git clone https://github.com/seanmorris/curvature-2</code>\n\n<a cv-link = \"https://github.com/seanmorris/curvature-2\">curvature source</a>\n\n<br />\n\n<h4>demo source</h4>\n\n<p>the source code of this demo is also available on github:</p>\n\n<code>$ git clone https://github.com/seanmorris/cv2-demo</code>\n\n<a cv-link = \"https://github.com/seanmorris/cv2-demo\">demo source</a>\n\n<br />\n"
});

